import React, { useState } from 'react';
import axios from 'axios';

const Register = () => {
  const [pnombre, setPnombre] = useState('');
  const [edad, setEdad] = useState(0);
  const [ubicacion, setUbicacion] = useState('');
  const [identificacion, setIdentificacion] = useState('');
  const [sNombre, setSNombre] = useState('');
  const [pApellido, setPApellido] = useState('');
  const [sApellido, setSApellido] = useState('');
  const [email, setEmail] = useState('');
  const [fechaNacimiento, setFechaNacimiento] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    const edadCalculada = calculateAge(fechaNacimiento);
    setEdad(edadCalculada);

    const personaData = {
      pnombre,
      edad: edadCalculada,
      ubicacion,
      identificacion,
      sNombre,
      pApellido,
      sApellido,
      email,
      fechaNacimiento,
    };

    // Aquí debes colocar la URL de tu API para el registro
    axios.post('http://tu_api_url/persona', personaData)
      .then(response => {
        console.log('Registro exitoso:', response.data);
      })
      .catch(error => {
        console.error('Error al registrar:', error);
      });
  };

  const calculateAge = (fechaNac) => {
    const today = new Date();
    const birthDate = new Date(fechaNac);
    let age = today.getFullYear() - birthDate.getFullYear();
    const monthDiff = today.getMonth() - birthDate.getMonth();
    if (monthDiff < 0 || (monthDiff === 0 && today.getDate() < birthDate.getDate())) {
      age--;
    }
    return age;
  };

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label>Primer Nombre:</label>
        <input type="text" value={pnombre} onChange={(e) => setPnombre(e.target.value)} required />
      </div>
      <div>
        <label>Ubicación:</label>
        <input type="text" value={ubicacion} onChange={(e) => setUbicacion(e.target.value)} required />
      </div>
      <div>
        <label>Identificación:</label>
        <input type="number" value={identificacion} onChange={(e) => setIdentificacion(e.target.value)} required />
      </div>
      <div>
        <label>Segundo Nombre:</label>
        <input type="text" value={sNombre} onChange={(e) => setSNombre(e.target.value)} />
      </div>
      <div>
        <label>Primer Apellido:</label>
        <input type="text" value={pApellido} onChange={(e) => setPApellido(e.target.value)} />
      </div>
      <div>
        <label>Segundo Apellido:</label>
        <input type="text" value={sApellido} onChange={(e) => setSApellido(e.target.value)} />
      </div>
      <div>
        <label>Email:</label>
        <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} required />
      </div>
      <div>
        <label>Fecha de Nacimiento:</label>
        <input type="date" value={fechaNacimiento} onChange={(e) => setFechaNacimiento(e.target.value)} required />
      </div>
      <div>
        <button type="submit">Registrar</button>
      </div>
    </form>
  );
};

export default Register;
